import React from 'react';
import Button from './Button';

function NavBar(btnNames) {
  return (
    <button type="button">
      { btnNames.map((name) => (
        <Button btnName={ name } key={ `btn-${name}` } />
      )) }
    </button>
  );
}

export default NavBar;
